1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2391073207324705363";}i:92;a:1:{s:10:"short_code";s:11:"CEuzGniiwJT";}i:93;a:1:{s:12:"created_time";i:1599258160;}i:94;a:1:{s:7:"caption";s:1817:"🌼 𝕀𝕟𝕤𝕡𝕚𝕣𝕒𝕥𝕚𝕠𝕟 𝔻𝕒𝕝í: "𝔻𝕒𝕤 ℝä𝕥𝕤𝕖𝕝 𝕕𝕖𝕣 𝔹𝕖𝕘𝕚𝕖𝕣𝕕𝕖"🌼

🌼Als Jugendliche war ich von seiner surrealen Welt und von den verträumten, organischen Formen begeistert. Dalír war mein erstes Vorbild, ich wollte malen wie er.

🌼Dann hat mir leider der Konsum das geniale Dalí-Vorbild vergehen lassen:
Die Kalenderbilder, die wirklich überall zu sehen waren, oder die Kunstdrucke seiner Werke, die an jeglichem Alltagsgegenstand wie Tasche, T-Shirt oder Trinktasse angebracht wurden. Oder die Uhren! Oh Gott, die verdrehten, zerfließenden Uhren, die man als Objek an den Schrank über die Kante hinstellen konnte...Dazu kam eine Miniatur der brennenden Giraffe 🦒 🔥 und ich merkte: es ist mir zu viel Dalí.

Mit Überflutung Dalís Werke als kitschiges Werbematerial zerrann, wie die Uhren, auch meine Begeisterung für diesen Künstler. 

Dennoch bleibt die erste Begegnung mit Dalí aus meiner Jugendzeit unvergesslich und ich erfreute mich, nach Abstand von mehr als zwei Jahrzehnte, an seinem künstlerischen Schaffen in der Pinakothek in München wieder. Immerhin ist es anderes, sich im Museum an dem Original, direkt von Hand des Künstlers erschaffen, auseinanderzusetzen als an irgendwelche bedruckte Tasse mit Darstellung storchbeiniger Elefanten zu glotzen. 
 
Kunst ist das Gegenteil von Konsum. Aber man kann auch sehr wohl Kunstwerke zum  Konsum machen. Und das ist der Tot der Originalität.
